import React from "react";
import { Link } from "react-router-dom";
import {
  Box,
  Container,
  Grid,
  Typography,
  IconButton,
  TextField,
  Button,
  Divider,
} from "@mui/material";
import {
  Facebook,
  Instagram,
  Twitter,
  YouTube,
  Email,
  Phone,
  LocationOn,
} from "@mui/icons-material";

export default function Footer() {
  const currentYear = new Date().getFullYear();

  const quickLinks = [
    { label: "Home", href: "/" },
    { label: "Products", href: "/products" },
    { label: "New Arrivals", href: "/products?category=new-arrivals" },
    { label: "Sale", href: "/products?sale=true" },
  ];

  const customerService = [
    { label: "Contact Us", href: "/contact" },
    { label: "FAQ", href: "/faq" },
    { label: "Shipping Info", href: "/shipping" },
    { label: "Returns & Exchanges", href: "/returns" },
  ];

  const categories = [
    { label: "Tops", href: "/products?type=Tops" },
    { label: "Bottoms", href: "/products?type=Bottoms" },
    { label: "Shoes", href: "/products?type=Shoes" },
    { label: "Accessories", href: "/products?type=Accessories" },
  ];

  return (
    <footer>
      {/* Newsletter Section */}
      <Box
        sx={{
          background: "linear-gradient(135deg, #667eea 0%, #764ba2 100%)",
          py: { xs: 4, sm: 6 },
        }}
      >
        <Container maxWidth="md" sx={{ px: { xs: 2, sm: 3 } }}>
          <Box sx={{ textAlign: "center" }}>
            <Typography
              sx={{ color: "white", fontWeight: 700, mb: 1, fontSize: { xs: "1.5rem", sm: "2rem" } }}
            >
              Subscribe to Our Newsletter
            </Typography>
            <Typography
              sx={{ color: "rgba(255,255,255,0.85)", mb: { xs: 2, sm: 3 }, fontSize: { xs: "0.85rem", sm: "1rem" } }}
            >
              Get the latest updates on new products and upcoming sales
            </Typography>
            <Box
              sx={{
                display: "flex",
                gap: 1,
                maxWidth: 500,
                mx: "auto",
                flexDirection: { xs: "column", sm: "row" },
              }}
            >
              <TextField
                placeholder="Enter your email"
                variant="outlined"
                size="small"
                fullWidth
                sx={{
                  bgcolor: "white",
                  borderRadius: { xs: 1, sm: 2 },
                  "& .MuiOutlinedInput-root": {
                    borderRadius: { xs: 1, sm: 2 },
                  },
                }}
              />
              <Button
                variant="contained"
                sx={{
                  bgcolor: "#ffd93d",
                  color: "#1a1a2e",
                  fontWeight: 600,
                  px: { xs: 3, sm: 4 },
                  whiteSpace: "nowrap",
                  fontSize: { xs: "0.85rem", sm: "1rem" },
                  "&:hover": {
                    bgcolor: "#ffcd00",
                  },
                }}
              >
                Subscribe
              </Button>
            </Box>
          </Box>
        </Container>
      </Box>

      {/* Main Footer */}
      <Box sx={{ bgcolor: "#1a1a2e", color: "white", py: 6 }}>
        <Container maxWidth="lg">
          <Grid container spacing={4}>
            {/* Brand Column */}
            <Grid item xs={12} md={4}>
              <Box sx={{ mb: 2 }}>
                <img
                  src="/logo-ltk.png"
                  alt="LTK Ecommerce"
                  style={{ height: "80px" }}
                />
              </Box>
              <Typography
                sx={{ color: "rgba(255,255,255,0.7)", mb: 3, maxWidth: 300 }}
              >
                Your one-stop destination for premium fashion. Quality meets
                style at unbeatable prices.
              </Typography>
              <Box sx={{ display: "flex", gap: 1 }}>
                <IconButton
                  sx={{
                    color: "white",
                    bgcolor: "rgba(255,255,255,0.1)",
                    "&:hover": { bgcolor: "#667eea" },
                  }}
                >
                  <Facebook />
                </IconButton>
                <IconButton
                  sx={{
                    color: "white",
                    bgcolor: "rgba(255,255,255,0.1)",
                    "&:hover": { bgcolor: "#667eea" },
                  }}
                >
                  <Instagram />
                </IconButton>
                <IconButton
                  sx={{
                    color: "white",
                    bgcolor: "rgba(255,255,255,0.1)",
                    "&:hover": { bgcolor: "#667eea" },
                  }}
                >
                  <Twitter />
                </IconButton>
                <IconButton
                  sx={{
                    color: "white",
                    bgcolor: "rgba(255,255,255,0.1)",
                    "&:hover": { bgcolor: "#667eea" },
                  }}
                >
                  <YouTube />
                </IconButton>
              </Box>
            </Grid>

            {/* Quick Links */}
            <Grid item xs={6} sm={4} md={2}>
              <Typography
                sx={{ fontWeight: 600, mb: 2, color: "#ffd93d" }}
              >
                Quick Links
              </Typography>
              {quickLinks.map((link) => (
                <Link
                  key={link.label}
                  to={link.href}
                  style={{ textDecoration: "none" }}
                >
                  <Typography
                    sx={{
                      color: "rgba(255,255,255,0.7)",
                      mb: 1,
                      "&:hover": { color: "white" },
                      transition: "color 0.2s",
                    }}
                  >
                    {link.label}
                  </Typography>
                </Link>
              ))}
